import React, {Component} from "react"

class MyApp extends Component{

    constructor(){
        super()
        this.state = {
            count: 0
        }
    }

    handleClick(){
        this.state.count = this.state.count + 1
    }

    render(){
        return(
            <div>
                <h1>{this.state.count}</h1>
                <button onClick={this.handleClick}>Change</button>
            </div>
        )
    }
}
export default MyApp
